  eventsCategory: string;
  radius: string;
  startTime: number;
  endTime: number;
  placeType: string;
  endDate: string;
  startDate: string;
  startFormatted: string;
  endFormatted: string;
  unixStartDate: string;
  unixEndDate: string;
  ticketMasterCategories: string;
  yelpCategories: string;
}
